import styled from "styled-components";

const DayBox = styled.li`
  list-style: none;
  width: 100%;
  height: 100%;
`;

export default function Day(props: { day: number }) {
  return day !== 0 ? (
    <DayBox>{props.day}</DayBox>
  ) : (
    <DayBox>{props.day}</DayBox>
  );
}
